  return (
    <>
      <Navbar />
      <div className="homepage">
        <div className="register">
          <img src={logo} alt="logo" className="logo"/>
          <span>Ainda n√£o tem uma conta?</span>
          <button>Aprende agora</button>
        </div>
      </div>
    </>
  );
}
